import { Component } from '@angular/core';
import { HttpClient, HttpHeaders } from '@angular/common/http';
import { Injectable } from '@angular/core';

@Component({
  selector: 'app-signup',
  templateUrl: './signup.component.html',
  styleUrls: ['./signup.component.css']
})

@Injectable({
  providedIn: 'root'
})

export class SignupComponent {

  constructor(private http: HttpClient) { }

   fazerSolicitacaoPost(formularioData: any) {
    const url = 'http://localhost:8080/user'; // Substitua pela URL do seu servidor Node.js
    const dados = { chave: 'valor' }; // Substitua pelos dados que deseja enviar no POST

    const headers = new HttpHeaders({
      'Content-Type': 'application/json'
    });

    this.http.post(url, dados, { headers }).subscribe(
      (response) => {
        console.log('Resposta do servidor:', response);
        // Faça algo com a resposta do servidor Node.js
      },
      (error) => {
        console.error('Erro na solicitação:', error);
        // Trate o erro, se necessário
      }
    );
  }

}
<div class="signup-container">
  <div class="signup-box">
    <h1>Criar Conta</h1>
    <form (ngSubmit)="fazerSolicitacaoPost()" #formulario="ngForm">
      <div class="input-group">
        <label for="nomeCompleto">Nome Completo:</label>
        <input
          name="name"
          type="text"
          id="nomeCompleto"
          placeholder="Digite seu nome completo"
          [(ngModel)]="nomeCompleto"
          required
        />
      </div>
      <div class="input-group">
        <label for="email">E-mail:</label>
        <input
          name="email"
          type="email"
          id="email"
          placeholder="Digite seu e-mail"
          [(ngModel)]="email"
          required
        />
      </div>
      <div class="input-group">
        <label for="senha">Senha:</label>
        <input
          name="password"
          type="password"
          id="senha"
          placeholder="Digite sua senha"
          [(ngModel)]="senha"
          required
        />
      </div>
      <div class="input-group">
        <label for="confirmaSenha">Confirmação de Senha:</label>
        <input
          type="password"
          id="confirmaSenha"
          placeholder="Confirme sua senha"
          [(ngModel)]="confirmaSenha"
          required
        />
      </div>
      <div class="input-group">
        <label for="dataNascimento">Data de Nascimento:</label>
        <input type="date" id="dataNascimento" [(ngModel)]="dataNascimento" />
      </div>
      <button type="submit" class="signup-button">Criar Conta</button>
      <button class="back-button" routerLink="/">Voltar</button>
    </form>
  </div>
</div>
